import React, { Component, Fragment } from "react";
import { Link } from "react-router-dom";
import { findBuildings} from "../api.js";
import PopupSearchNoBuildings from "./PopupSearchNoBuildings";
import buildingSearchImg from "../img/building-search.png";
import Odometer from 'react-odometerjs';
import Scrollbar from "react-scrollbars-custom";
var img = "data:image/png;base64,";
export default class ProjectLayoutSelectSpaces extends Component {
    constructor(props) {
        super(props);
        this.state = {
        };
    }
   
   getSpacesCount() {    
       return this.props.workspaces?this.props.workspaces.filter(w=>w.selected).length:0;
   }
   renderWorkspaces() {
       if(!this.props.workspaces) return null;
       return this.props.workspaces.map((workspace, i) => {
           return (
            <div className="layout-workspace-select">
                <img src={img} />
                <p>Sala de reuniones</p>
                {workspace.id}
            </div>);
       });
   }

    render() {
        var project = this.props.project;
        if (!project || project === "loading") return null;
        
        return (
            <Fragment>
            <div className="heading-content">
                <div className="project-tool-info">
                    <h2 className="tool-name">Layout</h2>                
                    <h1 className="subtool-name">
                        Escoge los espacios de tu oficina
                    </h1>
                </div>
                <div className="m2-heading-area">
                  <div className="inline-block float-right margin-right-50">
                      <p className="uppercase">Espacios Seleccionados</p>
                      <Odometer value={this.getSpacesCount()} format="(.ddd),dd" /> 
                  </div>
                </div>
            </div>
            <div className="content">
                <Scrollbar noScrollX={true} style={{ width: "100%", height: 380, whiteSpace: "nowrap", overflow: "visible" }}>
                    {this.renderWorkspaces()}
                    </Scrollbar>
               
                <div className="actions-area">
                    {/*<Link to={"/proyecto/" + (project?project.id:"") + "/busqueda_de_edificio/resultados"} className="button is-green is-rounded">
                        Continuar
                    </Link>*/}
                    <Link to={"/proyecto/" + (project?project.id:"") + "/layout/set"} className="button is-green is-rounded">
                        Continuar
                    </Link>
                </div>
            </div>
            {this.state.searching === "not_found" ? (
                    <PopupSearchNoBuildings
                        onDismiss={() =>
                            this.setState({ searching: false })
                        }
                    />
                ) : null}
            </Fragment>

              
        );
    }
}